from socket import *
import threading
import subprocess
import os

# gambar untuk background
def urlimage():
    return str("data:image/png;base64,")
def htmls(output,filename):
    daftar = ''
    # Mengecek apakah di dalam folder ini terdapat file
    if not output[0] == "" :
        # Jika ada, maka akan dibuat tabel yang berisi file yang ada di dalam server lalu melakukan perulangan dan mengecek file satu per satu
        for i in output:
            # mengalokasikan path dengan alamat dan nama file yang di inginkan client
            path = os.path.abspath(f"{os.getcwd()}\{filename}\{i}")
            # Mengecek jika file tersebut adalah folder atau file yang berformat
            if os.path.isdir(path):
                # Jika dia adalah file yang berformat maka akan dimasukin di HTML yang tidak berisi target="_blank"
                daftar += f'<tr><td><a href="http://127.0.0.1:10000/{filename}{i}" title="{i}">> {i}</a></td></tr>'
            else:
                # Jika dia adalah file yang berformat maka akan dimasukin di HTML yang berisi target="_blank"
                daftar += f'<tr><td><a href="http://127.0.0.1:10000/{filename}{i}" title="{i}" target="_blank">> {i}</a></td></tr>'
    # Jika folder di dalamnya kosong
    else:
        # Maka akan menampilkan tulisan "Folder Kosong"
        # Variabel daftar akan diisi dengan HTML yang bertulisan Folder Kosong, yang jika di klik maka akan mengalihkan pengguna ke halaman awal
        daftar = f'<tr><td><a href="http://127.0.0.1:10000/" title="Homescreen">Folder Kosong</a></td></tr>'
    # Variabel html akan diisi dengan HTML dan css dan menampilkan visual web
    html = f"<html><body style='background-image: url({urlimage()}), linear-gradient(#2491ef,#60b2f2,#60d6f2); background-repeat: repeat-x; background-position: bottom center; '><title>Tubes Jarkom</title><h1 style=' text-align: center; font-family: Century Gothic; color: white; text-decoration: none; text-shadow: 1px 1px rgba(0,0,0,0.5); font-weight: bold; padding-bottom: 40px; '>Tubes Jarkom</h1><style> a" + "{text-align: center; font-family: Century Gothic; color: white; text-decoration: none; text-shadow: 1px 1px rgba(0,0,0,0.5); font-weight: bold} </style>"+f"<table style='width:50%''>{daftar}</table></body></html>"
    # Function akan mereturn hasil kode html
    return html

def handle_client(ConnectionSocket,addr):
    message = ""
    try:
        # Menunggu client menekan sesuatu
        message = ConnectionSocket.recv(1024).decode()
        # Mengecek apakah client menekan sesuatu
        if not message == "":
            # Mengambil nama file yang client ingin akses
            filename = message.split()[1]  
            # Mengecek apakah nama file yang di inginkan client terdapat kata %20 
            if "%20" in filename:
                # Jika beneran ada, maka di gantikan dengan spasi
                filename = filename.replace("%20", " ")
            # mengalokasikan path dengan alamat dan nama file yang di inginkan client
            path = os.path.abspath(f"{os.getcwd()}\{filename}")
            # Apabila client ingin mengakses file yang ada formatnya (misal: pdf, word, txt, dll)
            if not os.path.isdir(path):
                # Server akan membuka file yang ingin client akses di server
                try:
                    # Python akan membuka file yang ingin client akses di server
                    with open(filename[1:], 'rb') as file_to_send:
                        # Mengirim sinyal (atau pesan error) ke browser bahwa url yang di tuju users tidak ditemukan (dapat di cek di Inspect Element > Network)
                        ConnectionSocket.send("HTTP/1.1 200 OK\r\n\r\n".encode())
                        # Program akan ngecompile file
                        for data in file_to_send:
                            # File akan dikirim ke client
                            ConnectionSocket.sendall(data)
                    # Python akan menampilkan tulisan bahwa client berhasil mengambil file tersebut 
                    print(f"[{addr[0]}:{addr[1]}]: Client berhasil mengambil {filename}","(200)")
                # Apabila client membatalkan unduhan file
                except ConnectionAbortedError:
                    # Python akan menampilkan tulisan bahwa client membatalkan mengambil file tersebut 
                    print(f"[{addr[0]}:{addr[1]}]: Client membatalkan file {filename}")
            # Apabila client ingin mengakses folder
            else:
                # Apabila client mengakses server dengan cara menuliskan IP dan socketnya saja
                if filename == "/":
                    # Program akan mengecek seluruh folder yang ada di direktori server
                    output = subprocess.getoutput(f"dir /b").split("\n")
                    # Memanggil dan memproses file HTML
                    html = htmls(output,"")
                else:
                    # Menghapus '/' di awalan 
                    filename = filename.split("/", 1)
                    # Server akan membuka folder yang ingin client akses di server lalu mengecek seluruh folder yang ada di direktori server
                    output = subprocess.getoutput(f"cd {''.join(filename)} & dir /b").split("\n")
                    # Memanggil dan memproses file HTML
                    html = htmls(output, f"{''.join(filename)}/")
                # Mengirim kode HTML kepada client
                ConnectionSocket.send("HTTP/1.1 200 OK\r\n\r\n".encode())
                # Python akan menampilkan tulisan bahwa client berhasil menuju url tersebut
                print(f"[{addr[0]}:{addr[1]}]:","Client berhasil terhubung ke server:", f"'{''.join(filename)}'","(200)")
                # Mengirim kode HTML kepada client
                ConnectionSocket.send(html.encode())
    except IOError:
        # Menampilkan HTML Error 404
        # Mengambil nama file yang client/browser ingin akses
        filename = message.split()[1]
        # Mengirim sinyal (atau pesan error) ke browser bahwa url yang di tuju users tidak ditemukan (dapat di cek di Inspect Element > Network)
        ConnectionSocket.send("HTTP/1.1 404 Not Found\r\n\r\n".encode())
        # Mengecek apakah si browser juga mengakses favicon.ico
        if not "/favicon.ico" in filename:
            # Variabel html akan diisi dengan HTML dan css dan menampilkan visual web
            html = f'<html lang="en"><head><title>Error 404</title> </head><body style=" background-image: url({urlimage()}), linear-gradient(#2491ef,#60b2f2,#60d6f2); background-repeat: repeat-x; background-position: bottom center;"> <style>'+'.yaini{ text-align: center; font-size: 20px; font-family: Century Gothic; color: white; text-shadow: 2px 2px rgba(0,0,0,0.5);} </style> <teks class="yaini"> <h1 style="padding-top: 20%;">404</h1> <h3>Halaman yang anda cari tidak ada</h3> </teks> </body></html>'
            # Mengirim kode HTML kepada client
            ConnectionSocket.send(html.encode())
            # Python akan menampilkan tulisan bahwa client gagal menuju url tersebut
            print(f"[{addr[0]}:{addr[1]}]:", "File yang dicari client tidak ada (404)")
    ConnectionSocket.close()


if __name__ == "__main__":
    # Ini buat atur jaringan
    # Membuat objek socket dengan menggunakan metode socket dari modul socket
    # AF_INET mengindikasikan bahwa kita menggunakan IPv4 untuk komunikasi,
    # SOCK_STREAM menunjukkan bahwa kita menggunakan protokol TCP/IP untuk mengirim data melalui socket
    serversocket = socket(AF_INET, SOCK_STREAM)
    serverport = 10000 # Menginisialisasi variabel serverport dengan nomor port 10000
    serversocket.bind(('127.0.0.1', serverport)) # Mengikat socket server ke alamat IP lokal (127.0.0.1) dan nomor port (serverport)
    serversocket.listen() # Memulai socket server untuk mendengarkan koneksi masuk
    while True: # Memulai loop tak terbatas untuk menerima koneksi dari client secara berulang
        # Menerima koneksi dari client menggunakan metode accept() pada socket server
        ConnectionSocket, addr = serversocket.accept()
        # Membuat objek thread (client) dengan target fungsi handle_client dan argumen ConnectionSocket dan addr
        # Ini memungkinkan pemrosesan paralel untuk setiap koneksi client menggunakan threading
        client = threading.Thread(target=handle_client, args=(ConnectionSocket,addr))
        # Memulai eksekusi thread dengan memanggil metode start()
        # Ini akan menjalankan fungsi handle_client secara simultan untuk setiap koneksi client
        client.start()
